import { useState,useEffect } from "react";
const BookList = () => {
    let[books,setBooks]=useState([])
    useEffect(()=>{
        let fetchData=async()=>{
             let response =await fetch(" http://localhost:1000/books");
              let data= await response.json();
              setBooks(data)
        }
    })
    return ( 
        <div className="bookList">
            <h1>Book List</h1>
        </div>
     );
}
 
export default BookList;
